import React from 'react';
import hc from './Header.module.css'
import {NavLink} from "react-router-dom";
import MessagesIcon from "../assetss/images/messageIcon.jpg"
import IconButton from "@material-ui/core/IconButton";
import AccountCircle from "@material-ui/core/SvgIcon/SvgIcon";
import MenuItem from "@material-ui/core/MenuItem";
import AccountIcon from '@material-ui/icons/AccountCircle';
import IconButtonHeader from '@material-ui/core/IconButton';



const Header = (props) => {
    return <header className={hc.header}>
        <div className={hc.item}>
            {props.IsLogined
                ?
                <>
                    <IconButtonHeader
                        aria-label="account of current user"
                        aria-controls="primary-search-account-menu"
                        aria-haspopup="true"
                        color="secondary"
                    >
                        <AccountIcon />
                    </IconButtonHeader>
                <div >{props.login}<div>
                    <button onClick={props.LogOutThunk} className={hc.log}>
                        Logout
                    </button>
                </div>
            </div>
                </>
                :
            <NavLink className={hc.log} to={'/login'} > Login </NavLink>}
        </div>
    </header>

}
export default Header;
